/** @format */

import React from "react";

class MovieList extends React.Component {
  constructor(props) {
    super(props);
    console.log(props.movies);
  }

  render() {
    return (
      <div>
        {this.props.movies.map(arr => (
          <p>{arr[0]}</p>
        ))}
      </div>
    );
  }
}

export default MovieList;
